char* ctc_sai_metadata_get_enum_value_name(ctc_sai_enum_metadata_t* metadata, int value)
{
    if (metadata == NULL)
    {
        return NULL;
    }

    uint32 i = 0;

    for (; i < metadata->valuescount; ++i)
    {
        if (metadata->values[i] == value)
        {
            return metadata->valuesnames[i];
        }
    }

    return NULL;
}


